import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
      <div className="counterHeader">
          <h1 className="display-4 text-dark text-center">React Counter</h1>
          </div>
        <div className="counterContent">
          <div className="counterBody">
          <h1 className="display-4 counterNumber">5</h1>
          <div className="counterButtons">
          <button className="btn btn-primary">Add Count</button><br/>
          <button className="btn btn-primary">Lower Count</button>
          </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
